import React from 'react';
import moment from 'moment'; 
import { AdoptModal } from '../modal/AdoptModal';
import { DeletePersonBtn } from '../ui/DeletePersonBtn';
import { EditPersonBtn } from '../ui/EditPersonBtn';

export const DataTableScreen = ({ id, fullname, birth, person, adopt }) => {

    const dispatch = useDispatch();
    
    const birthday =  moment(birth).format('L'); 

    return (
        <>  
            <tbody>
                <tr>
                <th scope="row">{ id }</th>
                <td>{ fullname }</td>
                <td>{ birthday }</td>
                <td>{ person }</td>
                <td>{ adopt }</td>
                <td><EditPersonBtn/><DeletePersonBtn/></td>
                </tr>
            </tbody>
            <AdoptModal />      
        </>
    )
}
